import CardMedia from "@mui/material/CardMedia";
import CardContent from "@mui/material/CardContent";
import Typography from "@mui/material/Typography";
import CardActions from "@mui/material/CardActions";
import Button from "@mui/material/Button";
import Card from "@mui/material/Card";
import * as React from "react";
import {FC} from "react";
import {ProductComponent} from "../BoxPreview";
import {Avatar, Container, Grid} from "@mui/material";
import {deepOrange} from "@mui/material/colors";

interface BoxComponentPreviewProps {
    productComponents?: ProductComponent[];
    total?: number;
    title: string;
}
export const BoxComponentPreview: FC<BoxComponentPreviewProps> = (props) => (
        <Card>
            <CardContent>
                <Typography variant="h2" color="text.secondary" >
                    {title}
                </Typography>
                <Typography variant="h4" textAlign='left' component="div" gutterBottom>
                    Лидер: {leader}
                </Typography>
                <Typography variant="h4" component="div" textAlign='left' gutterBottom>
                    Количество человек: {total}
                </Typography>
                <Grid container spacing={2}>
                    <Grid item>
                        <Typography variant="h4" component="div" textAlign='left'>
                            Состав:
                        </Typography>
                    </Grid>
                    {members?.length && members.map(({lastName, firstName, id}) => (
                        <Grid item key={id} style={{ display: 'flex'}}>
                            <Avatar sx={{ bgcolor: deepOrange[500], width: 64, height: 64 }}>{lastName[0]}{firstName[0]}</Avatar>
                        </Grid>
                    ))}
                </Grid>
            </CardContent>
            <CardActions>
                <Button size="small">Подробнее</Button>
            </CardActions>
        </Card>
);
